INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (7001, 7, 106001, 1, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (7002, 7, 105901, 1, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (7003, 7, 105801, 1, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (10001, 10, 106001, 1, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (10002, 10, 105901, 1, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (10003, 10, 105801, 1, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (12001, 12, 105801, 1, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -416.5, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (13001, 13, 106001, 1, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (13002, 13, 105901, 1, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (13003, 13, 105801, 1, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (14001, 14, 106001, 1, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (14002, 14, 105901, 1, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (14003, 14, 105801, 1, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (15001, 15, 105901, 1, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -470.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (16001, 16, 106001, 1, "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (16002, 16, 105901, 1, "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (16003, 16, 105801, 1, "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (17002, 17, 105901, 1, "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (17004, 25, 106001, 1, "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (17005, 25, 105901, 1, "コッコロ", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (17006, 25, 105801, 1, "ペコリーヌ", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (18001, 18, 190801, 1, "カリン", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (18002, 18, 190801, 1, "カリン", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (19001, 19, 190801, 1, "カリン", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -470.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (19002, 19, 190801, 1, "カリン", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -470.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (20001, 20, 190801, 1, "カリン", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -470.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (20002, 20, 190801, 1, "カリン", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -470.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (21001, 21, 106001, 1, "キャル", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (21002, 21, 105901, 1, "コッコロ", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (21003, 21, 105801, 1, "ペコリーヌ", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -363.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (22001, 22, 190801, 1, "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -430.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (22002, 22, 190801, 1, "カリン", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -430.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (23001, 23, 190801, 1, "カリン", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -430.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (23002, 23, 190801, 1, "カリン", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, "2015/12/17 15:00:00", "2030/12/17 14:59:59", -430.0, 0.0, 0.0, 1, 0, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24001, 24, 109001, 1, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 4.08, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24002, 24, 109001, 1, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 5.0, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24003, 24, 109001, 1, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 10.11, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24004, 24, 109001, 1, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 4.0, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24005, 24, 109001, 1, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 6.0, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24006, 24, 109002, 1, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24007, 24, 109002, 1, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24008, 24, 109002, 1, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24009, 24, 109002, 1, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24010, 24, 109002, 1, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24011, 24, 109101, 1, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 2.12, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24012, 24, 109101, 5, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 4.19, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24013, 24, 109101, 2, "シズル（バレンタイン）", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 2.3, 4, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24014, 24, 109102, 1, "シズル（バレンタイン）", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24015, 24, 109101, 5, "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 5.23, 2, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24016, 24, 109102, 1, "シズル（バレンタイン）", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 10011, 0);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (24017, 24, 109101, 1, "シズル（バレンタイン）", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, "2019/01/31 12:00:00", "2030/12/17 14:59:59", -385.0, 8.0, 5.01, 2, 10011, 0);
